import React from 'react';
import Maname from './components/Maname';
import ButtonMath from './components/ButtonMath';

import { css } from 'emotion'



import './App.css';

function App() {
  return (
    <div className="App">
      <div className={styles.header}>
        <header>
          <Maname />
        </header>
      </div>
      <div>
        {/* < AboutMe /> */}
        <ButtonMath />
      </div>
    </div>
  );
}

const styles = {
  header: css`
    display: flex;
    border: 2px black solid;
    width: 100%;
    height: 100%;
  `
}

export default App;
